  const onSubmit = () => {
    alert("Submitted");
  }


  return (

    <div className="App">
      <h1>Song Jae Hyeok</h1>
      <Counter/>
      <Counter/>
      <Counter/>
      <button onClick={ onSubmit }>Submit</button>
    </div>
  );
}

export default App;
